História - Maçonaria.

 A colocação da primeira pedra do Capitólio dos Estados Unidos e seu ritual maçônico: Washington, acompanhado por 3 Veneráveis Mestres carregando sacrifícios de milho, vinho e óleo, bateu na pedra 3 vezes com um martelo, conforme prescrito pelo costume maçônico. Washington emergiu da trincheira ao som do canto ritual maçônico e uma saudação de 15 tiros (um para cada estado dos EUA) da artilharia voluntária de Alexandria. Clark então fez uma breve invocação, após a qual um boi de 500 libras (230 kg) foi abatido e assado.

